import React from 'react';
import Navbar from '../components/Navbar';
import './About.css'; // импортируем файл стилей

const About = () => {
  return (
    <div className="about-container">
      <Navbar />
      <h1>Nomad's Odyssey</h1>
      <p>Our website is all about exploring the beauty of Kazakhstan through tourism. We offer a wide range of travel packages to help you discover the country's hidden gems and experience its unique culture. Join us on an unforgettable journey and let us help you create lasting memories.</p>
    </div>
  );
};

export default About;
